INSERT INTO `benefit` VALUES ('Compensation time','Compensation time means that for every extra hour you work overtime you can take up to an hour off. This may be a formal system that requires you to keep careful records, or it may mean that you have the flexibility to come in late or leave early, there may also be a cap to comp time.\r'),('Disability insurance','Life insurance usually affords a certain amount of basic coverage for employees with the option of buying additional coverage for employees and their families. Disability insurance provides a percentage of lost wages in case the employee is unable to work due to a nonâ€“work-related injury or illness. The period and cost of this kind of coverage varies from plan to plan, and is above any disability coverage required by the state.\r'),('Elder care','Child care is becoming more prevalent in benefits packages. If these issues affect your life, find out what the employer offers either in terms of payment or referrals.\r'),('Family-friendly','Workplace cultural practices that benefit families include recognizing the family responsibilities of fathers (not just mothers), and considering staff for promotions, raises, and bonuses even when they take advantage of family-friendly policies.\r'),('Flex time','Perhaps the employer canâ€™t be flexible about your salary, but they may be flexible about your work time. Could you reduce the number of hours on the job? Could you work alternate hours that would allow you to pursue other opportunities (whether paid or connected to other passions)?\r'),('Health insurance','This is one of the standard benefits that organizations usually offer full-time employees, most internships and part-time jobs will not provide health care benefits. \r'),('Job resources','Does the organization have the resources (equipment, office space, personnel, budgets, software, policies) that would make your work life easier? Is there a budget for other things that you need to do a good job? Some employers are willing to make adjustments or investments to accommodate your work needs. Consider if you need any other information about your work environment and the resources that will be at your disposal to evaluate the job offer properly.\r'),('Life insurance','Life insurance usually affords a certain amount of basic coverage for employees with the option of buying additional coverage for employees and their families. Disability insurance provides a percentage of lost wages in case the employee is unable to work due to a nonâ€“work-related injury or illness. The period and cost of this kind of coverage varies from plan to plan, and is above any disability coverage required by the state.\r'),('Parental leave','The Family and Medical Leave Act requires that most organizations with 50 or more employees provide up to three months of unpaid leave for personal or family illness, and parental leave for the birth of a child.\r'),('Personal leave','The Family and Medical Leave Act requires that most organizations with 50 or more employees provide up to three months of unpaid leave for personal or family illness, and parental leave for the birth of a child.\r'),('Phased retirement','For workers who plan to retire (eventually), some employers offer opportunities to gradually reduce responsibilities and working hours as a way to help ramp-up the knowledge and skills of the next generation of organizational leaders.\r'),('Professional development','Professional development reimbursement is an incredibly valuable part of a compensation package because, if you are someone new to the sector, you have much to learn about the field. Be sure to ask about opportunities to attend conferences or national meetings.\r'),('Relocation','If a position within an organization requires a move, sometimes an employer will help pay for your moving expenses. Employers can help defray the cost of a move in many different ways. Some employers will pay a percentage of your salary as their contribution to moving expenses. others will offer a flat contribution, still others reimburse an employee for the exact cost of the move. If relocation is necessary for the position, it is worth asking if compensation for relocation expenses is an option.\r'),('Retirement investment plans','The most common retirement plans are Sections 403(b) and 401(k). These plans allow employees to deduct a portion of their pre-tax salary and put it into a fund for their retirement, which can help employees fall into a lower tax bracket. The money is invested while in the account and cannot be taken out of the fund (without incurring penalties) until an employee reaches retirement age.\r'),('Sick leave','The Family and Medical Leave Act requires that most organizations with 50 or more employees provide up to three months of unpaid leave for personal or family illness, and parental leave for the birth of a child.\r'),('Tuition reimbursement','These programs help support an employeeâ€™s continuing education. Reimbursement can range from a single workshop or a college course to a full degree program. Larger organizations are more likely to offer a formal plan, although smaller organizations are often willing to negotiate time away from work for educational purposes, even if they canâ€™t help with the cost.\r'),('Vacation time','This is one of the more flexible and variable benefits. However, there are often specific guidelines on vacation days.');
/*!40000 ALTER TABLE `benefit` ENABLE KEYS */;
