DROP TABLE IF EXISTS `job`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `job` (
  `job_id` int(11) NOT NULL DEFAULT '0',
  `job_code` varchar(45) DEFAULT NULL,
  `job_title` varchar(200) CHARACTER SET utf8 DEFAULT NULL,
  `full_part_time` varchar(45) DEFAULT NULL,
  `job_schedule` varchar(45) DEFAULT NULL,
  `job_description` text CHARACTER SET utf8,
  `job_sector` varchar(200) CHARACTER SET utf8 DEFAULT NULL,
  `job_occupation` varchar(45) DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `salary` int(11) DEFAULT NULL,
  `salary_period` varchar(45) DEFAULT NULL,
  `salary_currency` varchar(45) DEFAULT NULL,
  `job_hours` int(11) DEFAULT NULL,
  `hours_period` enum('Year','Month','Week','Day') DEFAULT NULL,
  `telework` varchar(20) DEFAULT NULL,
  `job_type` varchar(45) DEFAULT NULL,
  `job_shift_type` varchar(45) DEFAULT NULL,
  `job_contract_type` varchar(45) DEFAULT NULL,
  `travel_to_work` varchar(20) DEFAULT NULL,
  `job_status` varchar(45) DEFAULT NULL,
  `employer_id` int(11) DEFAULT NULL,
  `isco_code2` varchar(45) DEFAULT NULL,
  `language` enum('en','ar','nl','fr','es') DEFAULT NULL,
  `desired_gender` varchar(45) DEFAULT NULL,
  `salary_to` int(11) DEFAULT NULL,
  PRIMARY KEY (`job_id`),
  KEY `job_employer_fk_idx` (`employer_id`),
  CONSTRAINT `job_employer_fk` FOREIGN KEY (`employer_id`) REFERENCES `employer` (`employer_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
